import './App.css';
import Logo from './Components/Logo';
import perfil from './Images/perfil.svg';
import sacola from './Images/sacola.svg';

const icones = [perfil, sacola]
const textoOpcoes = ['CATEGORIAS', 'MINHA ESTANTE', 'FAVORITOS', ]
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Logo className = 'logo' />
        <ul className='opcoes'>
          {textoOpcoes.map(opcao => <li className='opcao'>{opcao}</li>)}
        </ul>
        <ul className='icones'>
          {icones.map(icone => <li className='i'><img src={icone} /></li>)}
        </ul>
      </header>
    </div>
  );
}

export default App;
